function 排列物品图标(页数)
{
	删除物品图标();
	temp_x = this.物品图标._x;
	temp_y = this.物品图标._y;
	temp_h = 28;
	temp_l = 28;
	temp_j = 8;
	temp_k = 8;
	换行计数 = 0;
	temp_a = [];
	var p = 0;
	while (p < temp_j * temp_k)
	{
		p0 = (页数 - 1) * temp_j * temp_k + p;
		var itemData = _root.物品属性数组[p0];
		物品id = itemData.id;
		temp_a[p] = this.物品图标.duplicateMovieClip("物品图标" + p,p + 100);
		temp_a[p]._x = temp_x;
		temp_a[p]._y = temp_y;
		temp_x += temp_l;
		换行计数++;
		if (换行计数 == temp_j)
		{
			换行计数 = 0;
			temp_x = this.物品图标._x;
			temp_y += temp_h;
		}
		temp_a[p].数量 = 1;
		temp_a[p].物品id = 物品id;
		temp_a[p].图标 = "图标-" + itemData.icon;
		temp_a[p].gotoAndStop("默认图标");
		temp_a[p].图标是否可对换位置 = 0;
		if (_root.id物品名对应表[物品id] == null)
		{
			temp_a[p]._visible = 0;
		}
		temp_a[p].onRollOver = function()
		{
			_root.物品图标注释(_root.id物品名对应表[this.物品id],1);
		};
		temp_a[p].onRollOut = function()
		{
			_root.注释结束();
		};
		temp_a[p].onPress = function()
		{
			_root.修改工具界面.获得物品名 = _root.id物品名对应表[this.物品id];
			_root.修改工具界面.获得物品名多语言 = _root.获得翻译(_root.修改工具界面.获得物品名);
		};
		p++;
	}
}
function 查询排列物品图标(页数, 查询的物品)
{
	删除物品图标();
	if (!查询的物品)
	{
		排列物品图标(页数);
		已搜索 = false;
	}
	else
	{
		已搜索 = true;
		temp_x = this.物品图标._x;
		temp_y = this.物品图标._y;
		temp_h = 28;
		temp_l = 28;
		temp_j = 8;
		temp_k = 8;
		换行计数 = 0;
		temp_a = [];
		p = 0;
		if (已搜索的id)
		{
			p0 = 已搜索的id + 1;
		}
		else
		{
			p0 = 0;
		}
		while (p0 < _root.物品属性数组.length)
		{
			var itemData = _root.物品属性数组[p0];
			物品id = itemData.id;
			if (物品id == 查询的物品 || itemData.name.indexOf(查询的物品) > -1 || itemData.displayname.indexOf(查询的物品) > -1 || itemData.type.indexOf(查询的物品) > -1 || itemData.use.indexOf(查询的物品) > -1 || (itemData.actiontype && itemData.actiontype.indexOf(查询的物品) > -1) || (itemData.data && itemData.data.clipname && itemData.data.clipname.indexOf(查询的物品) > -1))
			{
				this.物品图标.duplicateMovieClip("物品图标" + p,p + 100);
				temp_a[p] = this["物品图标" + p];
				temp_a[p]._x = temp_x;
				temp_a[p]._y = temp_y;
				temp_x += temp_l;
				换行计数++;
				if (换行计数 == temp_j)
				{
					换行计数 = 0;
					temp_x = this.物品图标._x;
					temp_y += temp_h;
				}
				temp_a[p].数量 = 1;
				temp_a[p].物品id = 物品id;
				temp_a[p].图标 = "图标-" + itemData.icon;
				temp_a[p].gotoAndStop("默认图标");
				temp_a[p].图标是否可对换位置 = 0;
				if (_root.id物品名对应表[物品id] == undefined)
				{
					temp_a[p]._visible = 0;
				}
				temp_a[p].onRollOver = function()
				{
					_root.物品图标注释(_root.id物品名对应表[this.物品id],1);
				};
				temp_a[p].onRollOut = function()
				{
					_root.注释结束();
				};
				temp_a[p].onPress = function()
				{
					_root.修改工具界面.获得物品名 = _root.id物品名对应表[this.物品id];
					_root.修改工具界面.获得物品名多语言 = _root.获得翻译(_root.修改工具界面.获得物品名);
				};
				p++;
				if (p >= temp_j * temp_k)
				{
					已搜索的id = p0;
					break;
				}
			}
			p0++;
		}
	}
}
function 删除物品图标()
{
	var _loc2_ = 0;
	while (_loc2_ <= 80)
	{
		this["物品图标" + _loc2_].removeMovieClip();
		_loc2_ += 1;
	}
}
function 检测是否存在(名, 检测id)
{
	if (_root.根据装备名获得装备id(名) == 检测id)
	{
		this.attachMovie("图标-" + _root.物品属性列表[检测id][1],"图标test",this.getNextHighestDepth());
		if (this.图标test._x != undefined)
		{
			this.图标test.removeMovieClip();
			return true;
		}
	}
	return false;
}
