function 排列兵种图标(页){
	var 每页数量 = 8;
	for (var i = 0; i < 8; i++)
	{
		var 兵种id = (页 - 1) * 每页数量 + i;
		var 兵种属性 = _root.兵种库["兵种" + 兵种id];
		var 当前图标 = this["兵种图标" + i];
		//_root.单机版调试 += i + "   " + 当前图标._x + "" + 兵种属性.兵种名 + "\n";
		if (兵种属性.兵种名 == null)
		{
			当前图标.兵种属性 = null;
			当前图标.onPress = null;
			当前图标._visible = false;
			当前图标.多语言名字 = null;
			continue;
		}
		当前图标._visible = true;
		当前图标.兵种属性 = 兵种属性;
		当前图标.兵种id = 兵种id;
		当前图标.多语言名字 = _root.兵种库["兵种" + 兵种id].名字;
		当前图标.onPress = function()
		{
			_root.修改工具界面.兵种变量名 = "兵种" + this.兵种id;
			_root.修改工具界面.兵种名称 = _root.获得翻译(this.兵种属性.名字);
			_root.修改工具之出兵敌我属性 = this.兵种属性.是否为敌人;
			_root.修改工具界面.敌我属性MC.刷新();
			_root.修改工具界面.缩略图.图.removeMovieClip();
			if (this.兵种属性.兵种名 != "主角-男" && this.兵种属性.兵种名 != "主角-女")
			{
				_root.修改工具界面.缩略图.attachMovie(this.兵种属性.兵种名,"图",_root.修改工具界面.缩略图.getNextHighestDepth(),{兵种:this.兵种属性.兵种名});
			}
			var _loc3_ = 80;
			if (_root.修改工具界面.缩略图.图._width >= _root.修改工具界面.缩略图.图._height)
			{
				new_height = 100 * _root.修改工具界面.缩略图.图._height / _root.修改工具界面.缩略图.图._width;
				new_width = 100;
			}
			else if (_root.修改工具界面.缩略图.图._width < _root.修改工具界面.缩略图.图._height)
			{
				new_width = 100 * _root.修改工具界面.缩略图.图._width / _root.修改工具界面.缩略图.图._height;
				new_height = 100;
			}
			_root.修改工具界面.缩略图.图._width = new_width;
			_root.修改工具界面.缩略图.图._height = new_height;
			_root.修改工具界面.缩略图.图.stop();
			_root.修改工具界面.缩略图._xscale = _loc3_;
			_root.修改工具界面.缩略图._yscale = _loc3_;
		};
	}
	for (var each in _root.修改工具界面.缩略图)
	{
		_root.修改工具界面.缩略图[eval("each")].stop();
	}
	for (var each in _root.修改工具界面.缩略图.图)
	{
		_root.修改工具界面.缩略图.图[eval("each")].stop();
	}
}

