	_parent.任务编号 = Number(_parent.任务编号);
	if(_parent.任务编号 <= 0 || _parent.任务编号 > 999){
		_root.发布消息("未找到对应任务！");
		return;
	}
	var data = _root.getTaskData(_parent.任务编号);
	if (!data)
	{
		_root.发布消息("未找到对应任务！");
		return;
	}
	var loop = 0;
	while (loop < _root.tasks_to_do.length)
	{
		if (_root.getTaskData(_root.tasks_to_do[loop].id).chain[0] == data.chain[0])
		{
			_root.tasks_to_do.splice(loop,1);
		}
		loop += 1;
	}
	_root.GetTask(data.id);
	UpdateTaskProgress();
	if (_parent.任务编号 >= 1){
		_root.主线任务进度 = _parent.任务编号;
		_root.task_chains_progress.主线 = _parent.任务编号;
	}
	_root.检查任务数据完整性();
}

