on (release) {
	if (_parent.兵种名称 != "")
	{
		var 兵种 = _root.兵种库[_parent.兵种变量名];
		var 出兵tmp等级 = _parent.出兵等级;
		if (isNaN(出兵tmp等级))
		{
			出兵tmp等级 = 1;
		}
		var 数量 = _parent.出兵数量;
		if (isNaN(数量))
		{
			数量 = 1;
		}
		var i = 0;
		while (i < 数量)
		{
			_parent.出兵计数++;
			var 当前出兵 = _root.加载游戏世界人物(兵种.兵种名, "修改器" + 兵种.名字 + "-" + _parent.出兵计数, _root.gameworld.getNextHighestDepth(), {产生源:"修改器", _x:_root.gameworld[_root.控制目标]._x, _y:_root.gameworld[_root.控制目标]._y, 等级:出兵tmp等级, 名字:兵种.名字, 是否为敌人:_root.修改工具之出兵敌我属性, 身高:兵种.身高, 长枪:兵种.长枪, 手枪:兵种.手枪, 手枪2:兵种.手枪2, 刀:兵种.刀, 手雷:兵种.手雷, 脸型:兵种.脸型, 发型:兵种.发型, 头部装备:兵种.头部装备, 上装装备:兵种.上装装备, 下装装备:兵种.下装装备, 手部装备:兵种.手部装备, 脚部装备:兵种.脚部装备, 颈部装备:兵种.颈部装备, 性别:兵种.性别, 宠物属性:兵种.宠物属性});
			i++;
		}
	}
}
