on (release) {
	当前兵种页数 = Number(当前兵种页数);
	if (当前兵种页数 < 1 or isNaN(当前兵种页数))
	{
		当前兵种页数 = 1;
	}
	排列兵种图标(当前兵种页数);
}

on (release) {
	当前兵种页数 = Number(当前兵种页数);
	if (当前兵种页数 < 最大兵种页数)
	{
		当前兵种页数 += 1;
	}
	排列兵种图标(当前兵种页数);
}

on (release) {
	当前兵种页数 = Number(当前兵种页数);
	当前兵种页数 -= 1;
	if (当前兵种页数 < 1)
	{
		当前兵种页数 = 1;
	}
	排列兵种图标(当前兵种页数);
}

on (release) {
	当前兵种页数 = Number(当前兵种页数) + 10;
	if (当前兵种页数 >= 最大兵种页数)
	{
		当前兵种页数 = 最大兵种页数;
	}
	排列兵种图标(当前兵种页数);
}

on (release) {
	当前兵种页数 = Number(当前兵种页数);
	当前兵种页数 -= 10;
	if (当前兵种页数 < 1)
	{
		当前兵种页数 = 1;
	}
	排列兵种图标(当前兵种页数);
}

